import React, {Component} from 'react'
import './header.less'
/*
头部组件
 */
export default class Header extends Component{
    render(){
        return(
            <div className='header'>
                <div className='header-title'>首页</div>
                <div className='header-user'>
                    <span>欢迎， admin</span>
                    <a href="javascrip:">退出</a>
                </div>
            </div>
        )
    }
}
